        private List<Tuple<string, decimal, decimal>> missing = new List<Tuple<string, decimal, decimal>> { };
        private readonly EosBlockchainService _eosBlockchainService;

        public OrphanBalancesHandler(ILogger<QueuedHandler> logger, EosBlockchainService eosBlockchainService) : base(logger)
        {
            _eosBlockchainService = eosBlockchainService;
        }

        public override async Task DoWork()
        {
            foreach (var account in accounts)
            {
                //Task.Delay(1000).Wait();
                var result = await _eosBlockchainService.GetBalanceAsync(account, "euroexchange");
                var balances = new AccountBalanceResponse(result);
                var balance = balances.FirstOrDefault(b => b.Symbol.Equals("TREEP") && b.Balance > 0);
                if (!Equals(balance, null))
                {
                    holders.Add(new Tuple<string, decimal, decimal>(account, balance.Balance, balance.Staked));
                    await Console.Out.WriteLineAsync(JsonConvert.SerializeObject(holders.Last(), Formatting.None));
                }
            }

            var settlements = new List<SettlementTreepTokenVO> { };
            Parallel.ForEach(holders, new ParallelOptions { MaxDegreeOfParallelism = 1 }, async (holder) => 
            {
                using (var ctx = new GenbitDB_Context())
                {
                    var query = $"SELECT * FROM SettlementTreepToken WHERE Carteira = '{holder.Item1}'";
                    using (var command = ctx.Database.GetDbConnection().CreateCommand())
                    {
                        command.CommandText = query;
                        ctx.Database.OpenConnection();
                        using (var reader = command.ExecuteReader())
                        {
                            if (reader.HasRows)
                            {
                                while (reader.Read())
                                {
                                    settlements.Add(new SettlementTreepTokenVO
                                    {
                                        ContaId = reader.GetInt64(0),
                                        Simbolo = reader.GetString(1),
                                        Carteira = reader.GetString(2),
                                        Saldo = reader.GetDecimal(3),
                                        Transacoes = reader.GetInt32(4)
                                    });
                                }
                            }
                            else 
                            {
                                missing.Add(holder);
                            }
                        }
                    }
                }
                await Task.CompletedTask;
            });
            await Console.Out.WriteLineAsync(JsonConvert.SerializeObject(missing, Formatting.Indented));

            await Task.CompletedTask;
        }
    }
